@jbasants While this is a legitimate server issue, I think it can easily be addressed on your side. The problem is around the 10ms pull expire time. 
What are you trying to accomplish here? Can you describe your use case some and explain why you are doing this? Are you trying to limit the amount of time you wait? You could try a raw pull with no wait. I'm not sure either of these are the best pattern anyway, you are basically in a wait loop with continuous communication with the server, possibly causing a lot of cpu usage on the client and a lot of traffic / work for the server.
Is there any reason you can't use the simplification endless consume? It uses pull under the covers and you can choose to poll for messages with next or have the messages delivered to a handler as they come in from the server. I think either of those options would solve your problem, again without knowing your use case.

```
websocket: {
    tls {
      cert_file: "/etc/letsencrypt/live/nats-node-01.fra1.prod.do.spreadfighter.cloud/fullchain.pem"
      key_file: "/etc/letsencrypt/live/nats-node-01.fra1.prod.do.spreadfighter.cloud/privkey.pem"
    }
    compression: true,
    port: 8443
    handshake_timeout: "10s"
    authorization {
      username: "xxxxxx"
      password: "xxxxxxx"
    }
  }
